import React from 'react';

const Box = (props) => {
    //console.log("props : " , props)
    return (
        <div className="App mt-3">
            <div style={{width:200+'px', hegth:200+'px', backgroundColor:props.color}} onClick={()=>props.getColorFun(props.color)}>
            </div>  
        </div>
    );
}

export default Box
